import React, { useState } from 'react'

const Navbar = () => {
    const [isDark, setIsDark] = useState("false")

    



    return (
        <div className='navbar'>
            <span>My Notes</span>
            <div className='darkMode-switch'>
                <input type="checkbox" defaultChecked={isDark}  />
            </div>
        </div>
    )
}

export default Navbar
